import React from 'react'
import _ from 'lodash'
const PostRender = (props) => {
  const { results } = props.post
  console.log(results)
  const indi = results.map(results, post => {
    return (
      <li key={post.pk}>
        {post.name}
      </li>
    )
  })
  return ({ indi })
}

export default PostRender
